(1, 'Home', 'Home ', '&lt;b&gt;WELCOME to Top Gear Bd . This is the place where every mobile phones and accessories is within your reach. No matter what the price is on the market \\\\\\&quot; We will always make it right for you \\\\\\&quot; . Loyalty is the first thing that you can take granted from us.? But do remember that we try to make the price as low as possible so &lt;/b&gt;&lt;u&gt;&lt;b&gt;NO BARGAINING&lt;/b&gt;&lt;/u&gt;&lt;b&gt;.&lt;/b&gt;&lt;br /&gt;&lt;br /&gt;&lt;b&gt;We take cash and cards both. So enjoy your time with us, ask what you need and we will try our best to provide you the best. &lt;/b&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;', 4, 1, 'home'),
(2, 'About Us', 'Top Gear Bd', '&lt;b&gt;This is a low profit showroom. Our first target is to make the price of everything as limited as possible. This shop has been built for mainly students and mid-ranged salary employees. Our goal is to take the best products and make it reachable to every person. We have utter love for the technology and we are now sharing our love with everyone. &lt;/b&gt;&lt;br /&gt;&lt;br /&gt;&lt;b&gt;Technically hearing that we have second hand products lots of people gets misguided and things that we sell are low quality products or refined products. But in our definition second hand product means only those products which has been opened outside of our country for certain time and for certain reason . We assure you that non of our product is bought from Bangladesh. Our all products are either from United Kingdom (England) or USA (America). And for this kinds of misconception we give an extended version of our warranty system.&lt;/b&gt;&lt;br /&gt;&lt;br /&gt;&lt;b&gt;We give six months warranty on all of our products but do remember warranty system does not imply on accessories ( beacause no one in the world will give you warranty for accessories) . As far as the legal issues go , you will be provided with digital cash memos and a good looking warranty card which will give you warranty for six months . Again do remember its a \\\\\\&quot; service warranty \\\\\\&quot;nothing else.&lt;/b&gt;&lt;br /&gt;&lt;br /&gt;&lt;b&gt;If you lose the warranty card we will not give you any kind of service no matter how many? product you bought from us . And without our cash memo we will not accept any exchange offer. As far as our exchange offer goes we only exchange with OUR products . It means you can exchange with only those products which you bought from us previously with the new ones. And you can also sell our products to us. Exchange rate of our products is 20% of the current value of that product from our price list . And if you are willing to sell the product to us then it goes to 30% of our current price of that product. And all this can be done if you can provide our authentic memo. This system also goes same for the warranty . &lt;/b&gt;&lt;br /&gt;&lt;br /&gt;&lt;b&gt;Well this is all we have to say about us. Rest of it goes to the clients of ours. No matter what happens in Bangladesh our price is always right for you or as we hope something like that.? &lt;/b&gt;&lt;br /&gt;&lt;br /&gt;&lt;b&gt;Thank You? :) &lt;/b&gt;&lt;br /&gt;&lt;br /&gt;&lt;b&gt;--Brought to you by the Owner and members of Top Gear Bd&lt;/b&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;?&lt;br /&gt;', 2, 1, 'about-us'),
(3, 'Our Service', 'Top Gear Service ', '&lt;b&gt;To Get any kind of our mobile service you must provide the cash memo and the warranty card.? Remember our service options are also limited because we are not stave jobs. To get the service you must read the warranty card to see if your problem is within our system. &lt;/b&gt;&lt;br /&gt;&lt;br /&gt;&lt;b&gt;We really hope that you don\\\\\\&#039;t need to come to us for service. Although we do give good service. &lt;/b&gt;&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;', 2, 1, 'our-service');
